bd76' target='_blank'>Light Gray Canvas</a>and other Esri basemaps.</div><div><br /></div><div>This map was designed and created by Andrew Skinner.</div><div><br /></div>","tags":["vector","basemap","esri_vector","sample","web map","human geography","esri_basemap","Andrew Skinner","style"],"snippet":"This web map consists of vector tile layers that form a detailed basemap for the world, featuring a monochromatic style with content adjusted to support Human Geography information.","thumbnail":"thumbnail/thumbnail1579117155225.jpeg","documentation":null,"extent":[[-155.166,-45.5959],[104.4629,66.854]],"categories":[],"spatialReference":null,"accessInformation":"Sources: Esri, HERE, Garmin, FAO, NOAA, USGS,  OpenStreetMap contributors, and the GIS User Community","licenseInfo":"<img alt='' src='https://downloads.esri.com/blogs/arcgisonline/esrilogo_new.png' /> This work is licensed under the Esri Master License Agreement.<br /><div><a href='https://goto.arcgis.com/termsofuse/viewsummary' target='_blank'><b>View Summary</b></a> | <b><a href='https://goto.arcgis.com/termsofuse/viewtermsofuse' target='_blank'>View Terms of Use</a></b></div><div><br /></div><div>Alignment of boundaries is a presentation of the feature provided by our data vendors and does not imply endorsement by Esri or any governing authority.<br /></div>","culture":"en-us","properties":null,"advancedSettings":null,"url":null,"proxyFilter":null,"access":"public","size":1158,"subInfo":0,"appCategories":[],"industries":[],"languages":[],"largeThumbnail":"largethumbnail/HumanGeog_ThumbLarge.jpg","banner":null,"screenshots":[],"listed":false,"commentsEnabled":true,"numComments":6,"numRatings":6,"avgRating":4.642859935760498,"numViews":193920365,"contentStatus":"public_authoritative","scoreCompleteness":100,"groupDesignations":"livingatlas","tokenExpirationDate":-1,"lastViewed":1690398000000},"itemData":{"operationalLayers":[],"baseMap":{"baseMapLayers":[{"id":"VectorTile_8900","type":"VectorTileLayer","layer
